parameters.text:
=You are an AI Teacher Agent specialized in creating quiz questions from educational content.

Input : {{ $json.text }}

Your Task:
Generate multiple-choice quiz questions with correct answers that can be directly used with Google Forms API.
Requirements:

Create at least {{ $('On form submission').item.json['How many questions would you like to have in the quiz?'] }} questions based on the content
Each question must have exactly 4 options
Mark one option as the correct answer
Each question is worth 1 point
Focus on key concepts, important facts, and learning objectives
Use clear, student-friendly language
Avoid ambiguous or trick questions
Don't repeat similar questions

Return a valid JSON object with this exact structure:
{
  "requests": [
    {
      "createItem": {
        "item": {
          "title": "Question text here?",
          "questionItem": {
            "question": {
              "required": true,
              "grading": {
                "pointValue": 1,
                "correctAnswers": {
                  "answers": [
                    {
                      "value": "Correct answer text"
                    }
                  ]
                },
                "whenRight": {
                  "text": "Correct! Well done."
                },
                "whenWrong": {
                  "text": "Incorrect. The correct answer is [correct answer]."
                }
              },
              "choiceQuestion": {
                "type": "RADIO",
                "options": [
                  { "value": "Option 1" },
                  { "value": "Option 2 (correct)" },
                  { "value": "Option 3" },
                  { "value": "Option 4" }
                ],
                "shuffle": true
              }
            }
          }
        },
        "location": {
          "index": 0
        }
      }
    }
  ]
}

Important Notes:

The correct answer in correctAnswers.answers[0].value must EXACTLY match one of the option values in options
Use "shuffle": true to randomize option order for students
Customize whenWrong.text to include the correct answer
Index starts at 0 and increments for each question
Ensure all JSON is properly formatted and valid

Question Quality Guidelines:

Test understanding, not just memorization
Use varied question stems (What, Why, How, Which, etc.)
Include questions at different difficulty levels
Ensure distractors (wrong answers) are plausible but clearly incorrect
Avoid "all of the above" or "none of the above" options

parameters.jsCode:
// Get question array
const data = $('Questions Generate').first().json.output.requests;

// Get quiz URL from previous node
const quizUrl = $('Create Form').first().json.responderUri|| "";

// Prepare rows
let rows = [];

for (let i = 0; i < data.length; i++) {
  const req = data[i];

  const item = req.createItem.item;
  const question = item.title;
  const options = item.questionItem.question.choiceQuestion.options.map(o => o.value);
  const correctAnswer = item.questionItem.question.grading.correctAnswers.answers[0].value;

  rows.push({
    question: question,
    option1: options[0] || "",
    option2: options[1] || "",
    option3: options[2] || "",
    option4: options[3] || "",
    correct_answer: correctAnswer,

    // ‚≠ê ONLY FIRST ROW gets quiz URL
    quiz_url: i === 0 ? quizUrl : ""
  });
}

// Return to Sheet node
return rows.map(r => ({ json: r }));
